import math

def svm_rbf(c_values, gamma_values, dataset='dataset2.csv'):
  # Loading dataset
  data = pd.read_csv(dataset,header=None)
  X = data.iloc[:,:-1].values
  y = data.iloc[:,-1].values

  # Calculating rows and cols for the graphs' grid
  n = len(gamma_values)*len(c_values)
  cols = math.ceil(math.sqrt(n))
  rows = math.ceil(n/cols)

  if n == 1:
    size = 5
  else:
    size = 20

  # Create a grid for the subplots
  fig, axes = plt.subplots(nrows=rows, ncols=cols, figsize=(size, size))
  # Check if axes is a single Axes object and convert it to a NumPy array if necessary
  if not isinstance(axes, np.ndarray):
    axes = np.array([axes])

  axes = axes.flatten()

  for idx, (c, gamma) in enumerate([(c, g) for c in c_values for g in gamma_values]):
      ax = axes[idx]

      # Train the SVM model with RBF kernel
      svm_model = svm.SVC(kernel='rbf', C=c, gamma=gamma)
      svm_model.fit(X, y)

      # Show the points
      ax.scatter(X[:, 0], X[:, 1], c=y, zorder=10, cmap=plt.cm.Paired)

      # Show the separating hyperplane
      ax.axis('tight')

      # Extract the limit of the data to construct the mesh
      x_min = X[:, 0].min()
      x_max = X[:, 0].max()
      y_min = X[:, 1].min()
      y_max = X[:, 1].max()

      # Create the mesh and obtain the Z value returned by the SVM
      XX, YY = np.mgrid[x_min:x_max:500j, y_min:y_max:500j]
      Z = svm_model.decision_function(np.c_[XX.ravel(), YY.ravel()])

      # Make a color plot including the separating decision boundaries
      Z = Z.reshape(XX.shape)
      ax.pcolormesh(XX, YY, Z > 0, shading='auto')
      ax.contour(XX, YY, Z, colors=['k', 'k', 'k'], linestyles=['--', '-', '--'], levels=[-1, 0, 1])

      # Set the title with the current C and gamma values
      ax.set_title(f'C = {c}, gamma = {gamma}')

  if n > len(axes):
    fig.delaxes(axes[n - cols*rows])
  # Adjust layout to prevent overlap
  plt.tight_layout()

  # Show the entire figure
  plt.show()

"""I've created a function that creates the models given two vectors of possible C and gamma values."""

c_values = [0.25, 0.5, 1, 2, 4]
gamma_values = [0.25, 0.5, 1, 2, 4]

