from sklearn.preprocessing import StandardScaler
from sklearn.model_selection import train_test_split, StratifiedShuffleSplit
from sklearn.metrics import accuracy_score

def svm_split_scale(seeds=[42]):
    data = pd.read_csv('dataset3.csv')
    X = data.iloc[:, :-1].values
    y = data.iloc[:, -1].values

    accuracies = []

    for seed in seeds:
        splitter = StratifiedShuffleSplit(n_splits=1, test_size=0.25, random_state=seed)
        train_idx, test_idx = next(splitter.split(X, y))
        X_train, X_test = X[train_idx], X[test_idx]
        y_train, y_test = y[train_idx], y[test_idx]

        scaler = StandardScaler()
        X_train = scaler.fit_transform(X_train)
        X_test = scaler.transform(X_test)

        best_C = 2
        best_gamma = 0.5

        svm_model = svm.SVC(kernel='rbf', C=best_C, gamma=best_gamma)
        svm_model.fit(X_train, y_train)

        y_pred = svm_model.predict(X_test)
        accuracies.append(accuracy_score(y_test, y_pred))
    return accuracies

"""Let's see the accuracy with the seed 42 (the one I've set as default)."""

accuracy = svm_split_scale()
print(f'Accuracy: {accuracy[0]}')

"""Now, I'll execute differents seeds (from 0 to 10) in order to check if the seed transforms the accuracy."""

accuracies = svm_split_scale(seeds=range(10))
print(f'Accuracies:')
for seed, (accuracy) in enumerate(accuracies):
  print(f'{seed}: {accuracy}')
print(f'Mean: {np.mean(accuracies)} and Standard deviation: {np.std(accuracies)}')

